import Card from "../../../../ui/card/Card";
import Education from "./Education";

import "./basicsContainer.scss";

function BasicsContainer() {
  return (
    <Card className="basics">
      <p>Education</p>
      <Education />

      <p>Languages</p>

      <p>Driveing licese</p>

      <p>Interests</p>
    </Card>
  );
}

export default BasicsContainer;
